import React from 'react';
import {Static} from './Static';
import { testProperties } from './Static';
import './App.css';

function App() {
  return (
    <div className="App">
      <p style={{
        fontSize: '24px',
        fontWeight: '600',
        color: '#333',
        margin: '0',
        fontFamily: 'Bookman, URW Bookman L, serif',
        lineHeight: '1.4',
        marginTop: '0',
        paddingTop: '20px',
        paddingBottom: '0',
        paddingLeft: '15px',
        backgroundColor: 'white',
        }}>
          Подобранная недвижимость
      </p>
      <Static properties={testProperties} />
    </div>
  );
}

export default App;
